import React, { Component } from "react";

class MyApp extends React.Component{
      constructor()
      {
            super();
            this.state={
                  isLoading:true
            }
            
      }
      
      componentDidMount(){
            setTimeout(() => {
                  this.setState({
                        isLoading: false
                  })
            },2000)
      }
      render()
      {
            return(
                  <div>
                        <h1>{this.state.count}</h1>
                        <button onClick={this.handleClick}>Click me</button>
                  </div>
            )
      }
     
}
export default MyApp;
